let stretchTabsInstance = null;
module.exports = class stretchTab {

    constructor() {
        if (!stretchTabsInstance) {
            stretchTabsInstance = this;
            //set all other default values

            this.displayAs = 'Stretch Tabs';
            this.value = 'stretchTabs'
            this.type = 'TOGGLE';
            this.values = {'true-value':'mat-stretch-tabs', 'false-value': ''}
        }
        return stretchTabsInstance;
    }
}